import React from 'react';
import ToDoListItem from './ToDoListItem';

const ToDoList = (  ) =>{
    return(
      <ul>
        <li><ToDoListItem 
            label = "Moving 1"/>
        </li>
        <li><ToDoListItem 
            label = "Moving 2"
            important />
        </li>
      </ul>
    );
  };

  export default ToDoList;
